import React, { useState } from 'react';
import { tournamentServiceFixed as tournamentService } from '../../services/tournamentServiceFixed';

const TournamentAPITester = () => {
  const [testResults, setTestResults] = useState({});
  const [loading, setLoading] = useState(false);

  const testAPI = async (testName, apiCall) => {
    setLoading(true);
    try {
      console.log(`üß™ Testing ${testName}...`);
      const result = await apiCall();
      console.log(`‚úÖ ${testName} success:`, result);

      setTestResults(prev => ({
        ...prev,
        [testName]: {
          success: true,
          data: result,
          timestamp: new Date().toISOString()
        }
      }));
    } catch (error) {
      console.error(`‚ùå ${testName} failed:`, error);

      setTestResults(prev => ({
        ...prev,
        [testName]: {
          success: false,
          error: {
            message: error.message,
            status: error.response?.status,
            data: error.response?.data
          },
          timestamp: new Date().toISOString()
        }
      }));
    }
    setLoading(false);
  };

  const runAllTests = async () => {
    await testAPI('getAllTournaments', () => tournamentService.getAllTournaments());
    await testAPI('getAllTournamentsWithParams', () => tournamentService.getAllTournaments({ page: 1, limit: 5 }));
  };

  const testCreateTournament = async () => {
    const testData = {
      name: 'API Test Tournament',
      description: 'Test tournament created via API tester',
      sportType: 'FOOTBALL',
      maxTeams: 8,
      startDate: [2024, 12, 25, 10, 0, 0],
      endDate: [2024, 12, 25, 18, 0, 0],
      registrationDeadline: [2024, 12, 20, 23, 59, 59],
      location: 'Test Stadium',
      rules: 'Test rules',
      prizeInfo: 'Test prizes',
      contactInfo: 'test@example.com'
    };

    await testAPI('createTournament', () => tournamentService.createTournament(testData));
  };

  return (
    <div className="p-6 bg-white rounded-lg border border-gray-200 max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-6 text-gray-900">üß™ Tournament API Tester</h2>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
        <button
          onClick={runAllTests}
          disabled={loading}
          className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600 disabled:opacity-50"
        >
          Test Get APIs
        </button>

        <button
          onClick={testCreateTournament}
          disabled={loading}
          className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600 disabled:opacity-50"
        >
          Test Create Tournament
        </button>

        <button
          onClick={() => setTestResults({})}
          className="bg-gray-500 text-white px-4 py-2 rounded hover:bg-gray-600"
        >
          Clear Results
        </button>
      </div>

      {loading && (
        <div className="text-center py-4">
          <div className="inline-block animate-spin rounded-full h-8 w-8 border-b-2 border-blue-500"></div>
          <p className="mt-2 text-gray-600">Testing APIs...</p>
        </div>
      )}

      <div className="space-y-4">
        {Object.entries(testResults).map(([testName, result]) => (
          <div key={testName} className="border border-gray-300 rounded-lg p-4">
            <div className="flex items-center justify-between mb-2">
              <h3 className="font-semibold text-lg">
                {result.success ? '‚úÖ' : '‚ùå'} {testName}
              </h3>
              <span className="text-sm text-gray-500">{result.timestamp}</span>
            </div>

            <div className="bg-gray-100 rounded p-3 overflow-auto max-h-96">
              <pre className="text-sm">
                {JSON.stringify(
                  result.success ? result.data : result.error, 
                  null, 
                  2
                )}
              </pre>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TournamentAPITester;
